import React from 'react';
import ReactPlayer from 'react-player';

const VideoDsply = () => {
  return (
    <div className='iframe-container'>
      <ReactPlayer
        url='https://youtu.be/RPPR5Yqzapo'
        target='_blank'
        rel='noopener noreferrer'
        alt='Heifetz playing'
      />
    </div>
  );
};

export default VideoDsply;
